  false,\n\t\"url\": null,\n\t\"notes\": \"The layer \"Sinkhole_Boundaries\" is an
  SDE feature showing the location of many of the sinkholes found in the Springfield
  Missouri area. Each of the polygons located within the City of Springfield's incorporated
  area have been drawn to portray the physical boundary or \"rim\" of the sink. This
  rim is defined as the highest closed contour withing the sinkhole. All polygons
  located outside of the incorporated area are approximate and based on USGS 10 foot
  topographic information.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
